//{{{  .betaMate

lozBoard.prototype.betaMate = function (score) {

  return (score >= MINMATE && score <= MATE);
}

//}}}
//{{{  .alphaMate

lozBoard.prototype.alphaMate = function (score) {

  return (score <= -MINMATE && score >= -MATE)
}

//}}}
//{{{  .cleanPhase

lozBoard.prototype.cleanPhase = function (p) {

  if (p <= 0)            // because of say 3 queens early on.
    return 0;

  else if (p >= TPHASE)  // jic.
    return TPHASE;

  return p;
}

//}}}
//{{{  .isDraw

lozBoard.prototype.isDraw = function () {

  if (this.repHi - this.repLo > 100)
    return true;

  for (var i=this.repHi-5; i >= this.repLo; i -= 2) {

    if (this.repLoHash[i] == this.loHash && this.repHiHash[i] == this.hiHash)
      return true;
  }

  var numPieces = this.wCount + this.bCount;

  if (numPieces == 2)
    return true;

  var wNumBishops = this.wCounts[BISHOP];
  var wNumKnights = this.wCounts[KNIGHT];

  var bNumBishops = this.bCounts[BISHOP];
  var bNumKnights = this.bCounts[KNIGHT];

  if (numPieces == 3 && (wNumKnights || wNumBishops || bNumKnights || bNumBishops))  // K v K+N|B.
    return true;

  return false;
}

//}}}
//{{{  .netSlowEval

lozBoard.prototype.netSlowEval = function (turn) {

  const b  = this.b;
  const cx = colourMultiplier(turn)

  let h1 = Array(net_h1_size);
  for (let j=0; j < net_h1_size; j++) {
    h1[j] = net_h1_b[j];
  }

  for (let sq=0; sq<64; sq++) {

    const fr    = B88[sq];
    const frObj = b[fr];

    if (!frObj)
      continue;

    const index = inputIndex(frObj, fr);

    for (let i=0; i < net_h1_size; i++) {
      h1[i] += net_h1_w[index][i];
    }
  }

  let e = net_o_b;

  for (let i=0; i < net_h1_size; i++) {
    e += net_o_w[i] * net_activation(h1[i]);
  }

  return e * cx | 0;
}

//}}}
//{{{  .netFastEval

lozBoard.prototype.netFastEval = function (turn) {

  const cx = colourMultiplier(turn)

  let e = net_o_b;

  for (let i=0; i < net_h1_size; i+=1) {
    e += net_o_w[i] * net_activation(this.net_h1_a[i]);
  }

  return e * cx | 0;
}

//}}}
//{{{  .netReset

lozBoard.prototype.netReset = function () {

  this.net_h1_a.set(net_h1_b);

}

//}}}
//{{{  .netAdd

lozBoard.prototype.netAdd = function (obj, sq) {

  const i   = inputIndex(obj, sq);
  const h1i = net_h1_w[i];

  for (let h=0; h < net_h1_size; h+=1) {
    this.net_h1_a[h] += h1i[h];
  }
}

//}}}
//{{{  .netDel

lozBoard.prototype.netDel = function (obj, sq) {

  const i   = inputIndex(obj, sq);
  const h1i = net_h1_w[i];

  for (let h=0; h < net_h1_size; h+=1) {
    this.net_h1_a[h] -= h1i[h];
  }
}

//}}}
//{{{  .netMove

lozBoard.prototype.netMove = function (frObj,fr,to) {

  const i1 = inputIndex(frObj, fr);
  const i2 = inputIndex(frObj, to);

  const h1 = net_h1_w[i1];
  const h2 = net_h1_w[i2];

  for (let h=0; h < net_h1_size; h+=1) {
    this.net_h1_a[h] += h2[h] - h1[h];
  }
}

//}}}
//{{{  .netCapture

lozBoard.prototype.netCapture = function (frObj,fr,toObj,to) {

  const i1 = inputIndex(frObj, fr);
  const i2 = inputIndex(toObj, to);
  const i3 = inputIndex(frObj, to);

  const h1 = net_h1_w[i1];
  const h2 = net_h1_w[i2];
  const h3 = net_h1_w[i3];

  for (let h=0; h < net_h1_size; h+=1) {
    this.net_h1_a[h] += h3[h] - h2[h] - h1[h];
  }
}

//}}}
//{{{  .netPromote

lozBoard.prototype.netPromote = function (pawnObj,promoteObj,sq) {

  const i1 = inputIndex(pawnObj,    sq);
  const i2 = inputIndex(promoteObj, sq);

  const h1 = net_h1_w[i1];
  const h2 = net_h1_w[i2];

  for (let h=0; h < net_h1_size; h+=1) {
    this.net_h1_a[h] += h2[h] - h1[h];
  }
}

